import React from 'react';
import { motion } from 'framer-motion';
import { useTranslation } from 'react-i18next';
import './Skills.css';

const Skills = () => {
  const { t } = useTranslation();

  // Habilidades tÃ©cnicas (ordenadas por nivel)
  const technicalSkills = [
    { name: 'HTML5/CSS3', level: 95 },
    { name: 'JavaScript (ES6+)', level: 90 },
    { name: 'React', level: 88 },
    { name: 'TypeScript', level: 85 },
    { name: 'Node.js', level: 80 },
    { name: 'SQL/NoSQL', level: 78 },
    { name: 'Git/GitHub', level: 92 },
    { name: 'Firebase', level: 75 },
    { name: 'RESTful APIs', level: 88 },
    { name: 'GraphQL', level: 70 },
    { name: 'React Native', level: 75 },
    { name: 'TailwindCSS', level: 85 }
  ];

  // Habilidades profesionales
  const professionalSkills = [
    { name: t('skills.problemSolving'), level: 95 },
    { name: t('skills.communication'), level: 90 },
    { name: t('skills.teamwork'), level: 92 },
    { name: t('skills.adaptability'), level: 88 },
    { name: t('skills.timeManagement'), level: 85 },
    { name: t('skills.attention'), level: 95 }
  ];

  // Idiomas
  const languages = [
    { name: t('skills.spanish'), level: 100, note: t('skills.nativeLevel') },
    { name: t('skills.english'), level: 85, note: t('skills.advancedLevel') },
    { name: t('skills.french'), level: 60, note: t('skills.intermediateLevel') }
  ];

  // Animaciones sin opacidad
  const containerVariants = {
    hidden: { y: 20 },
    visible: {
      y: 0,
      transition: {
        type: 'spring',
        stiffness: 80,
        damping: 15,
        staggerChildren: 0.1,
        duration: 0.8
      }
    }
  };

  const skillVariants = {
    hidden: { 
      y: 15,
      scaleX: 0
    },
    visible: {
      y: 0,
      scaleX: 1,
      transition: {
        type: 'spring',
        stiffness: 50,
        damping: 10,
        duration: 0.8
      }
    }
  };

  return (
    <div className="skills-container">
      <div className="section-header">
        <h2>{t('skills.title')}</h2>
        <p>{t('skills.description')}</p>
      </div>

      <div className="skills-content">
        {/* Columna de habilidades tÃ©cnicas */}
        <motion.div 
          className="skills-column technical"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.2 }}
        >
          <h3>{t('skills.technical')}</h3>
          <div className="skills-list">
            {technicalSkills.map((skill, index) => (
              <div className="skill-item" key={index}>
                <div className="skill-info">
                  <span className="skill-name">{skill.name}</span>
                  <span className="skill-percentage">{skill.level}%</span>
                </div>
                <div className="skill-bar">
                  <motion.div 
                    className="skill-progress"
                    style={{ width: `${skill.level}%` }}
                    variants={skillVariants}
                  ></motion.div>
                </div>
              </div>
            ))}
          </div>
        </motion.div>

        {/* Columna de habilidades profesionales y lenguajes */}
        <div className="skills-right-column">
          {/* Habilidades profesionales */}
          <motion.div 
            className="skills-column professional"
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true, amount: 0.2 }}
          >
            <h3>{t('skills.professional')}</h3>
            <div className="skills-list">
              {professionalSkills.map((skill, index) => (
                <div className="skill-item" key={index}>
                  <div className="skill-info">
                    <span className="skill-name">{skill.name}</span>
                    <span className="skill-percentage">{skill.level}%</span>
                  </div>
                  <div className="skill-bar">
                    <motion.div 
                      className="skill-progress"
                      style={{ width: `${skill.level}%` }}
                      variants={skillVariants}
                    ></motion.div>
                  </div>
                </div>
              ))}
            </div>
          </motion.div>

          {/* Idiomas */}
          <motion.div 
            className="skills-column languages"
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true, amount: 0.2 }}
          >
            <h3>{t('skills.languages')}</h3>
            <div className="skills-list">
              {languages.map((language, index) => (
                <div className="skill-item" key={index}>
                  <div className="skill-info">
                    <span className="skill-name">{language.name}</span>
                    <span className="skill-note">{language.note}</span>
                  </div>
                  <div className="skill-bar">
                    <motion.div 
                      className="skill-progress"
                      style={{ width: `${language.level}%` }}
                      variants={skillVariants}
                    ></motion.div>
                  </div>
                </div>
              ))}
            </div>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default Skills;
